INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 190801, 3.414, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, "2025/01/31 12:00:00", -416.5, 2, 1000001, 62, 1, 0.0, "2030/01/01 14:59:59", "カリン");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 190801, 3.099, "ミッションをクリアして、\n報酬をゲットしましょう！", 1, "2025/01/31 12:00:00", -416.5, 2, 1000002, 62, 2, 0.0, "2030/01/01 14:59:59", "カリン");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 190801, 2.801, "受け取ることができる\n報酬があるようです\n確認してみてください", 1, "2025/01/31 12:00:00", -416.5, 2, 1000003, 63, 3, 0.0, "2030/01/01 14:59:59", "カリン");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (2, 190801, 0.0, "報酬がもらえますよ！\nチェックしてみてください", 1, "2025/01/31 12:00:00", -416.5, 2, 1000004, 63, 4, 0.0, "2030/01/01 14:59:59", "カリン");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (2, 190801, 2.12, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 1, "2025/01/31 12:00:00", -363.0, 1, 1000005, 64, 5, 0.0, "2030/01/01 14:59:59", "カリン");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 190801, 1.68, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1, "2025/01/31 12:00:00", -363.0, 2, 1000006, 64, 6, 0.0, "2030/01/01 14:59:59", "カリン");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (2, 190801, 2.33, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 1, "2025/01/31 12:00:00", -363.0, 1, 1000007, 64, 7, 0.0, "2030/01/01 14:59:59", "カリン");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (3, 133701, 5.18, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 10201, "2025/01/31 12:00:00", -285.0, 7, 1020101, 61, 101, -6.0, "2030/01/01 14:59:59", "ラビリスタ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 133901, 8.77, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 10201, "2025/01/31 12:00:00", -285.0, 2, 1020102, 61, 201, -2.0, "2030/01/01 14:59:59", "クリスティーナ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (6, 133801, 15.5, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 10201, "2025/01/31 12:00:00", -285.0, 1, 1020103, 61, 301, 0.0, "2030/01/01 14:59:59", "ネネカ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (2, 134301, 9.061, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 10202, "2025/02/28 12:00:00", -285.0, 5, 1020201, 61, 101, 0.0, "2030/01/01 14:59:59", "ランファ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 134401, 7.699, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 10202, "2025/02/28 12:00:00", -285.0, 2, 1020202, 61, 201, 0.0, "2030/01/01 14:59:59", "チカ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 134601, 8.595, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 10203, "2025/03/31 12:00:00", -285.0, 2, 1020301, 61, 101, 0.0, "2030/01/01 14:59:59", "アオイ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 134501, 7.758, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 10203, "2025/03/31 12:00:00", -285.0, 2, 1020302, 61, 201, 0.0, "2030/01/01 14:59:59", "クローチェ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (2, 132302, 7.0, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 10204, "2025/04/30 12:00:00", -285.0, 6, 1020401, 61, 101, 0.0, "2030/01/01 14:59:59", "ルイズマリー");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 132402, 7.904, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 10204, "2025/04/30 12:00:00", -285.0, 2, 1020402, 61, 201, 0.0, "2030/01/01 14:59:59", "イロハ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (4, 132502, 8.487, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 10204, "2025/04/30 12:00:00", -285.0, 2, 1020403, 61, 301, 0.0, "2030/01/01 14:59:59", "ソノ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 134901, 8.763, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 10205, "2025/05/31 12:00:00", -285.0, 2, 1020502, 61, 101, 0.0, "2030/01/01 14:59:59", "カノン");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 134801, 6.417, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 10205, "2025/05/31 12:00:00", -285.0, 3, 1020503, 61, 201, 0.0, "2030/01/01 14:59:59", "ツムギ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (3, 135001, 10.335, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 10206, "2025/06/30 12:00:00", -285.0, 7, 1020601, 61, 101, 0.0, "2030/01/01 14:59:59", "エリス");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (2, 135101, 6.281, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 10206, "2025/06/30 12:00:00", -285.0, 4, 1020602, 61, 201, 0.0, "2030/01/01 14:59:59", "シェフィ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 135201, 12.244, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 10206, "2025/06/30 12:00:00", -285.0, 2, 1020603, 61, 301, 0.0, "2030/01/01 14:59:59", "プレシア");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (2, 135301, 6.339, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 10207, "2025/07/31 12:00:00", -285.0, 8, 1020701, 61, 101, 0.0, "2030/01/01 14:59:59", "クリア");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (7, 135401, 8.184, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 10207, "2025/07/31 12:00:00", -285.0, 9, 1020702, 61, 201, 0.0, "2030/01/01 14:59:59", "アネモネ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (9, 129101, 3.906, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 10208, "2025/08/31 12:00:00", -285.0, 2, 1020801, 61, 101, 0.0, "2030/01/01 14:59:59", "アイラ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 129201, 14.465, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 10208, "2025/08/31 12:00:00", -285.0, 2, 1020802, 61, 201, 0.0, "2030/01/01 14:59:59", "シナツ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (4, 100101, 8.662, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 10208, "2025/08/31 12:00:00", -285.0, 3, 1020803, 61, 301, 0.0, "2030/01/01 14:59:59", "ヒヨリ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 100301, 10.915, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 10208, "2025/08/31 12:00:00", -285.0, 3, 1020804, 61, 401, 0.0, "2030/01/01 14:59:59", "レイ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, 135802, 6.042, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 10209, "2025/09/30 12:00:00", -285.0, 7, 1020901, 61, 101, 0.0, "2030/01/01 14:59:59", "ユキノ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (4, 135903, 9.402, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 10209, "2025/09/30 12:00:00", -285.0, 1, 1020902, 61, 201, 0.0, "2030/01/01 14:59:59", "サツキ");
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (8, 136902, 8.16, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 10209, "2025/09/30 12:00:00", -285.0, 1, 1020903, 61, 301, 0.0, "2030/01/01 14:59:59", "ルルィ");
